Chanva (Russian: Чаньва) is a river in Perm Krai, Russia, a left tributary of Yayva River. It is 70 kilometres (43 mi) long. The area of its drainage basin is 733 square kilometres (283 sq mi). It begins at the confluence of rivers Tsenva and Rassokha, on the north slope of mountain range Belyi Spoi. It is a mountain river with significant changes of elevation between source and mouth. It flows in a deep rocky valley. The mouth is downstream of the settlement Verh-Yayva. The most important of its tributaries, all small, are: 
*  Left: Kospash, Kostanok, Vetos, Stepanovka; 
*  Right: Anyusha, Berezovka.

Chikman (Russian: Чикман) is a river in Perm Krai, Russia, a left tributary of the Yayva River. It is 55 kilometres (34 mi) long with a drainage basin of 600 square kilometres (230 sq mi). It starts on the west slope of North Ural, north of Mount Sheludyak. Its mouth is upstream of the village Sukhaya, 221 kilometres (137 mi) from the mouth of the Yayva River. There are some small tributaries; the most significant are: 
*  Left: Poludennaya (33 km), Syuz (23 km), Talitsa (18 km); 
*  Right: Sukhaya

The Causapscal River (/koʊzɑːpskæl/) is a waterway of 61.0 kilometres (37.9 mi) located in the Matapedia Valley, in La Matapédia Regional County Municipality, in administrative regions of Bas-Saint-Laurent and Gaspésie-Îles-de-la-Madeleine, in Quebec, Canada. It is a tributary to the Matapedia River; where these two meet is called Les Fourches stream pool. The Causapscal River flows through the following townships successively: 
*  La Vérendrye (township), in the unorganized territory of Lac-Casault; 
*  Lagrange (township), in the unorganized territory of Ruisseau-des-Mineurs; 
*  Casault (township), in the unorganized territory of Lac-Casault; 
*  Blais (township), in the municipality of Saint-Tharcisius; 
*  Casault (township), in the unorganized territory of Lac-Casault; 
*  Lepage (township), in the municipality of Saint-Alexandre-des-Lacs; 
*  Casupscull (township), in the city of Causapscal. This river of the Matapédia Valley empties into the east bank of the Matapédia River, in the city of Causapscal, at the level of "Les Fourches" salmon pit.
